import React from "react";
import "../css/home.css";
import { Link } from "react-router-dom";
import Menu from "./Menu";
import HighlightMenu from "./HighlightMenu";
import FavoriteMenu from "./FavoriteMenu";
import MenuCard from "./MenuCard";
const Home = () => {
  const submitHandler = (e) => {
    console.log(e.target);
  };
  return (
    <div>
      <div className="home-page">
        <div className="container">
          <p className="p-yellow">Lezzeti Kaçırma</p>
          <p className="p-white">KOD ACIKTIRIR</p>
          <p className="p-white">PİZZA DOYURUR</p>
          <Link to="/siparis-ver" exact>
            <button className="btn btn-warning rounded-pill px-5">
              ACIKTIM
            </button>
          </Link>
        </div>
      </div>
      <div>
        <Menu />
      </div>
      <div>
        <HighlightMenu />
      </div>
      <div>
        <FavoriteMenu submitHandler={submitHandler} />
      </div>
      <div>
        <MenuCard />
      </div>
    </div>
  );
};
export default Home;
